import React from 'react';
import { TextField } from '../../components/TextField';

const TextFieldDemo = () => (
  <React.Fragment>
    <div>
      <p>This is a Disabled Input</p>
      <TextField name="disable" disabled="true" />
    </div>

    <div>
      <p>A Valid Input</p>
      <TextField name="valid" />
    </div>

    <div>
      <p>An Input with errors</p>
      <TextField error name="error" defaultValue="101" isError="true" />
    </div>
  </React.Fragment>
);
export default TextFieldDemo;
